const Notification = (message, name) => {
    if(message === null) {
        return null
    } else if(message == "") {
        return (
            <div className="Added">
                <p>{message} {name}</p>
            </div>
        )
    } else if(message == "") {
        return (
            <div className="removed">
                {message}
            </div>
        )
    } else if(message == "") {
        return (
            <div className="changed">
                {message}
            </div>
        )
    }
}

export default Notification
